    function saveUser(){
        const array = [name,username,email]
        let data ={name,username,email}
       fetch("https://jsonplaceholder.typicode.com/users",{
       method:"post",
       header:{
            'Accept':'application/json',
            'content-type':'application/json'
       },
       body:JSON.stringify(data)

       }).then((result)=>{
        console.log("result",result)
       })
    }

  return (
    <div>

        <h1>Post API Example</h1>
        <input type="text" name="name" value={name} onChange={(e)=>{setName(e.target.value)}} /><br/><br/><br/>
        <input type="text" name="name" value={username}  onChange={(e)=>{setUserName(e.target.value)}} /><br/><br/><br/>
        <input type="text" name="name" value={email}  onChange={(e)=>{setEmail(e.target.value)}} /><br/><br/><br/>
        <button onClick={saveUser}>Save New User</button>
    </div>
  )
}

export default Form
